  const [contries, setContries] = useState([]) 

  useEffect(() => {
    axios
    .get('https://restcountries.eu/rest/v2/all')
    .then(response => {
      console.log(responses.data)
      setContries(response.data)

    })

  })

  return ( 
  <div>  
      <p>find countries <input />
      </p>
  </div>
  )
}


ReactDOM.render(
    <App />,
